  const {themeState} = useContextGlobal();
  return (
    <footer className={themeState.theme} style={{background: 'red'}}>
        <p>Powered by</p>
        <img src={logo} alt='DH-logo' />
        <img src=''></img>
    </footer>
  )
}

export default Footer
